import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.css';

export default class Navbar extends Component {


  render() {
    return (
      <div class="card">
         <div class="card-header">
            this is the header
         </div>
         <div class="card-body">
            this is the body
         </div>
      </div>
    )
  }
}
